    //       }).then((res) => {
    //           console.log("ressss", res)
    //          for (const val of res) {
    //              dataSet1.push(val.in_rs_lakh);
    //              label.push(val.description);
    //          }
 
    //        setData({
    //          labels:label,
    //          datasets: [
    //            {
    //              label: 'Cost',
    //              data:dataSet1,
    //              borderColor: 'rgb(258, 199, 132)',
    //              backgroundColor: 'rgba(25, 190, 130)',
    //              size:4,
    //              padding:1,
    //            },
    //          ],
    //        })
    //       })
    //      }
    //      fetchData();          
    //  },[]);
 




  const [products, setProducts] = useState([]);
  const [data, setData] = useState([]);


  useEffect(()=> {
  const fetchProducts = async () => {
    const dataSet1 = [];
    const label=[];
    const response = await axios
      .get("http://localhost:3001/dd")
      .catch((err) => console.log(err));

    if (response) {
      const products = response.data;

      console.log("Products: ", products);
      setProducts(products);
    }
    for (const val of products) {
            dataSet1.push(val.in_rs_lakh);
            label.push(val.description);
            console.log("itemsss:",dataSet1);
                 }
    console.log("itemsss1:",dataSet1,label);

  setData({
    labels:"description",
    datasets: [
      {
        label: 'Cost',
        data:dataSet1,
        borderColor: 'rgb(258, 199, 132)',
        backgroundColor: 'rgba(25, 190, 130)',
        size:4,
        padding:1,
      },
    ],
  })
  
}
fetchProducts();
},[]);

const productsData = useMemo(()=> [...products], [products]);

const productsColumns = useMemo(
  () =>
    products[0]
      ? Object.keys(products[0])
          .filter((key) => key !== "rating")
          .map((key)=>{
              return {Header: key.toUpperCase().replace('_',' '), accessor: key,}
            }): [], [products]);

const tableInstance = useTable(
  {columns: productsColumns, data: productsData},
  useGlobalFilter,
  useSortBy);

const { getTableProps, getTableBodyProps, headerGroups, rows, prepareRow, preGlobalFilteredRows, setGlobalFilter, state }=tableInstance;

// useEffect(()=>{setData({
//              labels:"description",
//              datasets: [
//                {
//                  label: 'Cost',
//                  data:dataSet1,
//                  borderColor: 'rgb(258, 199, 132)',
//                  backgroundColor: 'rgba(25, 190, 130)',
//                  size:4,
//                  padding:1,
//                },
//              ],
//            })
//   fetchProducts();
// },[]);

return (
  <Box m="20px">
      <Header
        title="TRANSMISSION LINE DASHBOARD"
        subtitle="Transmission Line details"
      />


{/* Table */}

<>
<GlobalFilter preGlobalFilteredRows={preGlobalFilteredRows} setGlobalFilter={setGlobalFilter} globalFilter={state.GlobalFilter}/>
<Table style={{margin:'20px 20px 20px 60px', width:'90%',height:'10px', overflowY:'scroll'}}{...getTableProps()}>
  <TableHead>
      {headerGroups.map((headerGroup) => (
            <TableRow {...headerGroup.getHeaderGroupProps()}>
              {headerGroup.headers.map((column) => (
                <TableHeader {...column.getHeaderProps(column.getSortByToggleProps())}>
                    {column.render("Header") }
                    {column.isSorted ? (column.isSortedDesc ? " ▼" : " ▲") : ""}
                    </TableHeader>
              ))}
              </TableRow>
      ))}
  </TableHead>
  <TableBody {...getTableBodyProps()}>
                {rows.map((row)=>{
                  prepareRow(row);

                  return (
                  <TableRow {...row.getRowProps()}>
                  {row.cells.map((cell, idx) =>(
                    <TableData {...cell.getCellProps()}>
                    {cell.render("Cell")}
                  </TableData>
                  ))}
                  </TableRow>
                  );
                })}

  </TableBody>
</Table>
</>
<Header
        title="TRANSMISSION LINE DASHBOARD"
        subtitle="Bar Chart"
      />
   
    <Box height="75vh">
        {/* BarChart */}
    
<Bar data={data} options={options}/>

  </Box>
  

      <Header
        subtitle="Doughnut Chart"
      />

    {/* <Box height="75vh" m="0 0 200px 200px">
        <PieChart />
      </Box>

      <Header
        subtitle="Line Chart"
      />

      <Box height="75vh">
        <LineChart />
      </Box> */}
    </Box>  
  );
};

export default Inventory;
